import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

class CustomerInfo extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            question: ""
        }
    }
    render(){
        return(
            <form>
                <label>
                    {this.props.question + " "}
                </label>
                <input type = "text">

                </input>
            </form>
        );
    }
}

class Calculator extends React.Component{
    render(){
        return(
            <div>
                <CustomerInfo
                question = "How many miles have you driven this year?"
                />
                <CustomerInfo
                question = "How much have you paid for insurance this year?"
                />
                <CustomerInfo
                question = "How many miles have you drive this year?"
                />
            </div>
        );
    }
}

ReactDOM.render(
    <Calculator />,
    document.getElementById("root")
  );
